import React from 'react'
import ReactDOM from 'react-dom';
import Sdata from './Sdata';


function Card(Props) {

    return (

        <div className='cards'>
            <div className='card'>
                <img src={Props.imgsrc} alt='' className='card-img' />
                <div className='card-info'>
                    <span className='card-category'>A Netflix Original Series</span>
                    <h3 className='card-title'>{Props.cardTitle}</h3>
                    <a href='#'>
                        <button> Watch Now</button>
                    </a>
                </div>
            </div>
        </div>
    )

}

ReactDOM.render(
    <>
        <Card
            imgsrc={Sdata[0].imgsrc}
            cardTitle={Sdata[0].cardTitle}
            link={Sdata[0].link}
        />
        <Card
            imgsrc={Sdata[1].imgsrc}
            cardTitle={Sdata[1].cardTitle}
            link={Sdata[1].link} />
        <Card
            imgsrc={Sdata[3].imgsrc}
            cardTitle={Sdata[3].cardTitle}
            link={Sdata[3].link} />
        <Card
            imgsrc={Sdata[4].imgsrc}
            cardTitle={Sdata[4].cardTitle}
            link={Sdata[4].link} />

    </>,
    document.getElementById('root')
);
